-- ----------------------------
-- Table structure for ucpm_account
-- ----------------------------
DROP TABLE IF EXISTS `ucpm_account`;
CREATE TABLE `ucpm_account`  (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `username` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `password` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '密码',
  `mobile` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手机号',
  `mobile_type` tinyint(1) NULL DEFAULT 1 COMMENT '手机号前缀(可扩展其它国家前缀,默认1大陆+86)',
  `status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '账户状态(0-禁用1-启用,如果账号被禁用,账号所关联所有身份将无法登录)',
  `tenant_code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '租户编码',
  `create_by` bigint(20) NULL DEFAULT NULL COMMENT '创建人',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) NULL DEFAULT NULL COMMENT '更新人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `del_flag` tinyint(1) NULL DEFAULT 0 COMMENT '删除状态(0-正常,1-已删除)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '账户表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of ucpm_account
-- ----------------------------

