-- ----------------------------
-- Table structure for ucpm_menu
-- ----------------------------
DROP TABLE IF EXISTS `ucpm_menu`;
CREATE TABLE `ucpm_menu`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `parent_id` bigint(32) NOT NULL DEFAULT 0 COMMENT '父ID(为0则一级)',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单标题',
  `path` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单路径',
  `component` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '组件',
  `menu_type` tinyint(1) NULL DEFAULT NULL COMMENT '菜单类型(0-主菜单,1-子菜单,2-按钮权限)',
  `client_code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户端编码',
  `biz_type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '业务类型(可做为业务类型区分的扩展字段)',
  `perms` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '按钮权限编码(前端用来控制是否显示按钮)',
  `sort_no` int(10) NULL DEFAULT NULL COMMENT '菜单排序(建议菜单之前步调相差10,方便后续菜单排序调整)',
  `icon` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单图标',
  `is_leaf` tinyint(1) NULL DEFAULT NULL COMMENT '是否为子节点(1-是, 0-不是)',
  `keep_alive` tinyint(1) NULL DEFAULT 1 COMMENT '是否缓存开启页面缓存(1-是,0-不是)',
  `hidden` tinyint(1) NULL DEFAULT 0 COMMENT '是否隐藏路由(1-是,0-不是)',
  `is_out_url` tinyint(1) NULL DEFAULT 0 COMMENT '是否为外部链接(1-是,0-不是)',
  `module` tinyint(1) NULL DEFAULT NULL COMMENT '模块(可作为端区分,管理端/H5等)',
  `enabled` tinyint(1) NULL DEFAULT 1 COMMENT '启用标识(1-正常,0-禁用)',
  `create_by` bigint(20) NULL DEFAULT NULL COMMENT '创建人',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) NULL DEFAULT NULL COMMENT '更新人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `del_flag` tinyint(1) NULL DEFAULT 0 COMMENT '删除状态(0-正常,1-已删除)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1430801075510300680 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '菜单表' ROW_FORMAT = Dynamic;

